import React from 'react'
// import LoginForm from "./components/login/loginform";
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
// import Signup from './components/login/signup';
import ExpenseItem from './components/Expenses/ExpenseItem';
import NewExpense from './components/NewExpense/NewExpense';
// import Expenses from './components/Expenses/Expenses';
import ExpenseForm from './components/NewExpense/ExpenseForm';
import ExpensesList from './components/Expenses/ExpensesList';
import ExpensesChart from './components/Expenses/ExpensesChart';
import Card from './components/UI/Card';
import Expenses from './components/Expenses/Expenses';
import ExpensesFilter from './components/Expenses/ExpenseFilter';
import ExpenseDate from './components/Expenses/ExpenseDate';
import ChartBar from './components/Chart/ChartBar';
import './components/NewExpense/ExpenseForm.css';
import './components/NewExpense/NewExpense.css';
import './components/Expenses/Expense.css';
import './components/Expenses/ExpenseDate.css';
import './components/Expenses/ExpenseFilter.css';
import './components/Expenses/ExpensesList.css';
import './components/Chart/Chart.css';
import './components/Chart/ChartBar.css';
import './components/UI/Card.css';

function App() {
  return (

  <Router>
  <Routes>
    {/* // <Route path="/" element={<LoginForm />} />
    // <Route path="/signup" element={<Signup />} /> */}
    <Route
    path='/'
    element={<NewExpense/>}
    />
    <Route
    path='/'
    element={<ExpenseForm/>}
    />
     <Route
    path='/'
    element={<ExpensesList/>}
    />
     <Route
    path='/'
    element={<ExpensesChart/>}
    />
     <Route
    path='/'
    element={<Card/>}
    />
     <Route
    path='/'
    element={<Expenses/>}
    />
     <Route
    path='/'
    element={<ExpenseItem/>}
    />
     <Route
    path='/'
    element={<ExpensesFilter/>}
    />
    <Route
    path='/'
    element={<ExpenseDate/>}
    />
     <Route
    path='/'
    element={<ChartBar/>}
    />



  </Routes>
</Router>
  )
}

export default App;
